import styled from "styled-components";

export const SignInSignUpContainer = styled.div`

width: 850px;
display: flex;
justify-content: space-between;
margin: 30px auto;

@media screen and (max-width: 800px){

 flex-direction: column;
 align-items: center;
 width: 96%;
 > *:first-child {
    margin-bottom: 50px;
  }
}

`
